package com.jsp.footmap.model;public class ResponseUser {    private String username;    private String nickname;    private String email;    private int status;    private int manager;    public String getUsername() {        return username;    }    public void setUsername(String username) {        this.username = username;    }    public String getNickname() {        return nickname;    }    public void setNickname(String nickname) {        this.nickname = nickname;    }    public String getEmail() {        return email;    }    public void setEmail(String email) {        this.email = email;    }    public int getStatus() {        return status;    }    public void setStatus(int status) {        this.status = status;    }    public int getManager() {        return manager;    }    public void setManager(int manager) {        this.manager = manager;    }}